import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import Home from './Home';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  /*<React.StrictMode>
    <App />
  </React.StrictMode>,*/
  <React.StrictMode>
    <Home/>
  </React.StrictMode>,
  document.getElementById('root')
);

